package holux

import (
	"bytes"
	"encoding/base64"
	"testing"
)

func multiRead(c Conn, prefixes ...string) error {
	var err error
	for _, s := range prefixes {
		err = c.ReadReply(s)
		if err != nil {
			return err
		}
	}
	return nil
}

